import React, { useState } from 'react';
import { TextInput, StyleSheet, View, Text } from 'react-native';
import { NavigationContainer } from '@react-navigation/native';
import ClienteApp from './screens/AppCliente';
import { createStackNavigator } from '@react-navigation/stack';

const users = {
    "cliente": {
        "type": "cliente",
        "password": "cliente",
    },
    "restaurante": {
        "type": "restaurante",
        "password": "restaurante",
    },
    "estafeta": {
        "type": "estafeta",
        "password": "estafeta",
    },
}

const Tab = createStackNavigator();

export default function AppContent() {
    return (
        <NavigationContainer independent={true}>
            <Tab.Navigator initialRouteName='Home' headerMode='none'>
                <Tab.Screen name="Home" component={Login} />
                <Tab.Screen name="Restaurantes" component={ClienteApp} />
            </Tab.Navigator>
        </NavigationContainer>);
}

function Login() {
    return (
        <View style={styles.container}>
            <Text style={styles.title}>Nutrilink</Text>
            <View style={styles.loginContainer}>
                <View style={styles.inputView}>
                    <TextInput placeholder='Username' style={styles.input} />
                </View>
                <View style={styles.inputView}>
                    <TextInput placeholder='Password' style={styles.input} secureTextEntry />
                </View>
                <TouchableOpacity style={styles.loginButtonContainer}>
                    <Text style={styles.payButtonText}>Login</Text>
                </TouchableOpacity>
            </View>
        </View>
    );
}

const styles = StyleSheet.create({
    container: {
        backgroundColor: 'darkcyan',
        alignItems: 'center',
        padding: 10,
        flex: 1

    },
    loginContainer: {
        backgroundColor: 'darkcyan',
        alignItems: 'center',
        justifyContent: 'center',
        flex: 1
    },
    title: {
        fontSize: 25,
        fontWeight: 'bold',
        color: 'cornsilk'
    },
    inputView: {
        borderBottomWidth: 10,
        borderBottomColor: 'darkcyan'
    },
    input: {
        backgroundColor: 'darkgray',
        padding: 15,
        borderRadius: 5,
    },
    loginButtonContainer: {
        elevation: 8,
        backgroundColor: "#009688",
        borderRadius: 10,
        paddingVertical: 10,
        paddingHorizontal: 12
    },
    payButtonText: {
        fontSize: 18,
        color: "#fff",
        fontWeight: "bold",
        alignSelf: "center",
        textTransform: "uppercase"
    }
});
